import React from "react";
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
import { Product, ProductDetail} from "../views";
const Router = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Product />} exact />
        <Route path="/product/:id" element={<ProductDetail />} />       
      </Routes>
    </BrowserRouter>
  );
};

export default Router;
